import React from "react";
import chart from "./images/chart.png";
import wallet from "./images/wallet.png";
import classes from "./Slider.module.css";
import Rol from "../svgfiles/rol.svg";
const Slider = () => {
  return (
    <div style={{ marginTop: "100px" }}>
      <div className="row mt-5">
        <div className=" col-sm-12 col-lg-5">
          <div className="w3-container w3-center w3-animate-left ab">
            <div className="jsx-3028322757 icon-container small-lottie-icon">
              <div
                style={{
                  width: "100%",
                  height: "100%",
                  overflow: "hidden",
                  margin: "0 auto",
                  outline: "none",
                }}
                title
                role="button"
                aria-label="animation"
                tabIndex={0}
              >
            <img className={classes.rotate} src={Rol} alt="rol" />

              </div>
            </div>

          </div>

          <div class="jsx-3028322757 info-texts-section"><span class="jsx-3028322757 info-texts-header">Access all your crypto from one screen</span><div class="jsx-3028322757 info-texts-description">You have entered the crypto market.<span class="jsx-3028322757 highlighted"> And it approves of no hiatus.</span></div><div class="jsx-3028322757 info-texts-description">Managing your portfolio, your Etherum and Metamask wallets, trading on diverse exchange accounts while tracking market fluctuations from one platform gives an apparent power of broader awareness.<span class="jsx-3028322757 highlighted"> Use the force.</span></div><div class="jsx-3028322757 info-texts-description"><span class="jsx-3028322757 highlighted">Track, analyse and get market insights for Bitcoin, Ripple and over 7000 other coins.</span> Use a cryptotracker that ensures instant visibility and the comfort of a smart interface. Manage your whole crypto portfolio. <span class="jsx-3028322757 highlighted">All in one place.</span></div></div>

        </div>
        <div className=" col-sm-12 col-lg-7 mt-3">
          <div className="w3-container w3-center w3-animate-right">
            <img className={classes.chart} src={chart} alt="chart" />
            <img className={classes.wallet} src={wallet} alt="chart" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Slider;
